// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

// 투표 시스템 스마트 컨트랙트
contract Voting {
    // 후보자 정보를 저장하는 구조체
    struct Candidate {
        uint id;         // 후보자 고유 식별 번호
        string name;     // 후보자 이름
        uint voteCount;  // 후보자가 받은 투표 수
    }

    // 투표자 정보를 저장하는 구조체
    struct Voter {
        bool authorized; // 투표 권한 부여 여부
        bool voted;      // 투표 완료 여부
        uint vote;       // 투표한 후보자의 ID
    }

    // 상태 변수 선언
    address public owner;           // 컨트랙트 소유자(관리자) 주소
    string public electionName;     // 선거 이름
    uint public startTime;          // 선거 시작 시간 (타임스탬프)
    uint public endTime;            // 선거 종료 시간 (타임스탬프)
    uint public candidateCount;     // 등록된 총 후보자 수
    uint public totalVotes;         // 총 투표 수

    // 매핑(키-값 저장소) 선언
    mapping(address => Voter) public voters;        // 투표자 주소 => 투표자 정보
    mapping(uint => Candidate) public candidates;   // 후보자 ID => 후보자 정보

    // 이벤트 선언 - 블록체인에 기록되는 로그
    event VoteCast(address voter, uint candidateId);           // 투표 완료시 발생하는 이벤트
    event CandidateAdded(uint candidateId, string name);       // 후보자 등록시 발생하는 이벤트
    event VoterAuthorized(address voter);                      // 투표 권한 부여시 발생하는 이벤트
    event VoterUnauthorized(address voter);                    // 투표 권한 철회시 발생하는 이벤트

    // 접근 제어 수정자
    modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    // 투표 기간 확인 수정자
    modifier duringVotingPeriod() {
        require(block.timestamp >= startTime, "Voting has not started yet ");
        require(block.timestamp <= endTime, "Voting has ended");
        _;
    }

    // 생성자 함수 - 컨트랙트 배포시 1회 실행
    constructor(string memory _name, uint _votingDuration) {
        owner = msg.sender;                                     // 컨트랙트 배포자를 소유자로 설정
        electionName = _name;                                  // 선거 이름 설정
        startTime = block.timestamp;                           // 현재 시간을 시작 시간으로 설정
        endTime = block.timestamp + _votingDuration;           // 종료 시간 = 현재 시간 + 투표 기간
    }

    // 후보자 등록 함수 - 관리자만 실행 가능
    function addCandidate(string memory _name) public onlyOwner {
        candidateCount++;                                      // 후보자 수 증가
        candidates[candidateCount] = Candidate(candidateCount, _name, 0);  // 새 후보자 정보 저장
        emit CandidateAdded(candidateCount, _name);           // 이벤트 발생
    }

    // 투표 권한 부여 함수 - 관리자만 실행 가능
    function authorize(address _person) public onlyOwner {
        require(!voters[_person].voted, "Person has already voted");
        voters[_person].authorized = true;                     // 투표 권한 부여
        emit VoterAuthorized(_person);                        // 이벤트 발생
    }

    // 투표 권한 철회 함수 - 관리자만 실행 가능
    function unauthorize(address _person) public onlyOwner {
        require(!voters[_person].voted, "Cannot unauthorize after voting");
        voters[_person].authorized = false;                    // 투표 권한 철회
        emit VoterUnauthorized(_person);                      // 이벤트 발생
    }

    // 투표 함수 - 투표 기간 중에만 실행 가능
    function vote(uint _candidateId) public duringVotingPeriod {
        require(voters[msg.sender].authorized, "Not authorized to vote");
        require(!voters[msg.sender].voted, "Already voted");
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");

        voters[msg.sender].voted = true;                      // 투표 완료 표시
        voters[msg.sender].vote = _candidateId;               // 투표한 후보자 기록
        candidates[_candidateId].voteCount++;                 // 후보자의 득표수 증가
        totalVotes++;                                         // 총 투표수 증가

        emit VoteCast(msg.sender, _candidateId);             // 투표 완료 이벤트 발생
    }

    // 투표 종료 및 결과 확인 함수 - 관리자만 실행 가능
    function end() public onlyOwner view returns (string memory) {
        require(block.timestamp > endTime, "Voting period has not ended yet");

        if (totalVotes == 0) {
            return "No votes cast";
        }

        uint winningVoteCount = 0;                           // 최다 득표수
        string memory winnerName = "";                       // 당선자 이름

        // 최다 득표자 찾기
        for (uint i = 1; i <= candidateCount; i++) {
            if (candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates[i].voteCount;
                winnerName = candidates[i].name;
            }
        }

        // 결과 문자열 생성 및 반환
        return string(abi.encodePacked("Winner: ", winnerName, ", votes: ", uint2str(winningVoteCount)));
    }

    // 숫자를 문자열로 변환하는 내부 함수
    function uint2str(uint _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        // 자릿수 계산
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        // 각 자릿수를 문자로 변환
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

    // 후보자 정보 조회 함수
    function getCandidate(uint _candidateId) public view returns (string memory, uint) {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.name, candidate.voteCount);         // 후보자 이름과 득표수 반환
    }

    // 전체 투표 결과 조회 함수
    function getResults() public view returns (uint[] memory) {
        uint[] memory result = new uint[](candidateCount);
        for (uint i = 1; i <= candidateCount; i++) {
            result[i-1] = candidates[i].voteCount;           // 각 후보자별 득표수 배열 생성
        }
        return result;                                       // 전체 득표 결과 반환
    }

    // 선거 상태 확인 함수
    function getElectionStatus() public view returns (bool) {
        return block.timestamp <= endTime;                   // 현재 선거가 진행 중인지 여부 반환
    }
}

